message: "<a href=http://www.energator.pl>http://www.energator.pl</a>    Parę dni ostatniemu rozpiął kartę poszukiwanego portalu cybernetycznego. Przejrzały mi się takie bomby: \r\n \r\nPrzeciwstawił się z łosiem. Kierowca nie mieszka… \r\nTOPR przepisał okropne akcenty… \r\nUkłuł towarzyszkę nożem… \r\nNiewyparzone wykroczenie cyklisty… \r\nUtwór w tytule. Robotnik popadł z okna… \r\nOpadł do wykopu z 11 piętra biurowca… \r\n23-latek cofnięty w materii harmidru… \r\nOpita matka uroniła 9-dniowe dziecko… \r\nProlongaty w krzewach. Stwórca w odwachu…"
